import React, { Component } from 'react'
import NavDropdown from 'react-bootstrap/NavDropdown';
export class FilterDropDowns extends Component {

    constructor(props) {
        super(props);
        console.log(props)

    }
    render() {
        const params=this.props.details
        this.navDropDown = params.fields.map((option)=>(
            <NavDropdown.Item >{option}</NavDropdown.Item>
        ))
        return (
            <NavDropdown title={params.title} id="basic-nav-dropdown">
        {this.navDropDown}
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
        )
    }
}

export default FilterDropDowns;
